import React from 'react';
import classes from './Dialogs.module.css';
import {NavLink} from "react-router-dom";


function Dialogs(props) {
    return (
        <div className={classes.dialogs}>
            <div className={classes.dialogItems}>
            <div className={classes.dialog + ' ' + classes.active}>
                <NavLink to={dialogs/1}>Dima</NavLink></div>
            <div className={classes.dialog}>Ann</div>
            <div className={classes.dialog}>Art</div>
            <div className={classes.dialog}>Eva</div>
            <div className={classes.dialog}>Karen</div>
            </div>




            <div className={classes.messages}>
                <div className={classes.message}>Hi!!!</div>
                <div className={classes.message}>How is your it-kamasutra?????</div>
                <div className={classes.message}>Yoo</div>
            </div>


        </div>
    )
}


export default Dialogs;
